import React from 'react'
import AffichereFil from './AffichereFil'
export default function App() {
  let ListeModules=["Module11","Module12","Module13"];
  let Fillier=[
    {codefil:24,nomfil:"TDI"},
    {codefil:23,nomfil:'Resaux'},
    {codefil:55,nomfil:'commerece'}
      ]
  return (
    <div>
      <AffichereFil codeF={Fillier[0].codefil} nomF ={Fillier[0].nomfil} />
    </div>
  )
}
